import BurgerDescription from './Details';
import Foodlist from './Foodlist';

function App() {

  return (

    <Router>
       <div className="App">
    </div>
    <Routes>
      <Route  exact path="/burgers" element={<Foodlist />}></Route>
      <Route exact path="/burger/:id" element={<BurgerDescription />}></Route>
    </Routes>
    </Router>

  );
}

export default App;
